window.bookSummaryJSON = "<p>A highly decorated Navy SEAL shares stories of his years of combat experience in Afghanistan, providing leadership insights that will shift your view of yourself and provoke life-altering change. </p> <p>Before leaving for combat in Afghanistan, Navy SEAL Thom Shea promised his wife that he would write to his children in case he didn't make it back. What was initially intended to be a private memoir for his family turned into a powerful set of lessons for anyone striving to perform beyond what they believe possible. Shea's stories, while action-packed and entertaining, provide incredible insights on leadership, family, and excellence. </p>"; 
